import React from 'react'
import { View, Text,Image } from 'react-native'
import pet7 from "../../images/pet7.png";
import storyring from "../../images/Storyring.png";
import tw from "twrnc";

export default function OthersStory({style}) {
    return (
        <View style={tw`flex-row ${style}`}>
             <Image style={tw`w-[72px] h-[72px]`} source={storyring} />
             <Image style={tw`w-[60px] h-[60px] rounded-full absolute top-[6px] left-[6px]`} source={pet7} />
        </View>
    )
}
